VALUES ('20796600', 'Tortilla espanola oignons', 'Omelette aux pommes de terre et aux oignons. Ingrédients 43 % pommes de terre, 35 % Œuf liquide pasteurisé, huile de tournesol, 10 % oignons frits (oignons, huile d\'olive vierge, sel), sel, Œuf en poudre, stabilisants : carraghénanes, farine de graines de caroube, gomme xanthane, chlorure de potassium ; amidon modifié de pomme de terre, maltodextrines, huile d\'olive, acidifiant : acide citrique. Conseils de préparation Ne pas consommer cru. Retirez l\'emballage. Avant cuisson, badigeonner l\'omelette d\'un peu d\'huile. Au micro-ondes : recouvrir l\'omelette et réchauffer 3 minutes à 900 Watts. À la poêle : recouvrir l\'omelette avec un couvercle et réchauffer à feu doux pendant 2 minutes. Retourner de temps en temps. Au four : préchauffer le four à 2000C. Déposer l\'omelette à mi-hauteur et réchauffer pendant 5 minutes. Conditions de conservation A conserver entre OOC et +40C. Non ouvert, à consommer jusqu\'au : voir face avant. Après ouverture, à consommer sous 24 heures.', '', '8.8', '1.4', '9.7', '1.1', '', '3.1', '1.08', '0.425196850393701', '', '0');

